import React, { Component } from "react";
import { connect } from "react-redux";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBCol,
  MDBIcon,
  MDBBtn,
  MDBView,
  MDBContainer,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBFormInline,
  MDBAnimation,
} from "mdbreact";
// components
import Menu from "./menu/menu";

// import img
import img from "../assets/bg1.jpg";

export class Index extends Component {
  render() {
    return (
      <div>
        <Menu />
        <div>
          {" "}
          <MDBContainer>
            <MDBRow className="py-5">
              <MDBCol md="12" className="text-center mt-5">
                <p>Trouver une salon prés de chez toi !!</p>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(Index);
